        self.assertEqual(writer1_fa, expected_writer1_fa)
        self.assertEqual(writer2_fa, expected_writer2_fa)
        self.assertEqual(writer1_fc, expected_writer1_fc)
        self.assertEqual(writer2_fc, expected_writer2_fc)
    
 
        

        
       
